import React from 'react';

const Profile = ({ user }) => {
    const messages = user.messages
    return (
        <div>
            {
                messages && messages.map(message => {
                    return (
                        <div key={message._id}>{message.content}</div>
                    )
                })
            }
        </div>
    )
}

export default Profile;
